import React, { useState, useEffect, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import { useToast } from './ToastProvider';
import '../styles/Quiz.css';

function Quiz() {
  const [questions, setQuestions] = useState([]);
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [selectedAnswers, setSelectedAnswers] = useState([]);
  const [score, setScore] = useState(0);
  const [isFinished, setIsFinished] = useState(false);
  const [isAnswerChecked, setIsAnswerChecked] = useState(false);
  const [courseId, setCourseId] = useState(null);
  const [totalLessons, setTotalLessons] = useState(0);
  const [saving, setSaving] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();
  const toast = useToast();

  // ObÈ›ine userId din localStorage
  const userId = localStorage.getItem('userId');
  const authToken = localStorage.getItem('authToken');

  useEffect(() => {
    const courseIdFromUrl = window.location.pathname.split('/')[2];
    setCourseId(courseIdFromUrl);

    // Verificare autentificare
    if (!userId || !authToken) {
      console.error('Utilizatorul nu este autentificat');
      setError('Trebuie sÄƒ fii autentificat pentru a susÈ›ine testul.');
      toast.error('Trebuie sÄƒ fii autentificat pentru a susÈ›ine testul.');
      return;
    }

    // AnunÈ›Äƒ utilizatorul cÄƒ testul a fost Ã®ncÄƒrcat
    toast.info('Testul se Ã®ncarcÄƒ...', 2000);

    fetch(`http://localhost:5000/api/courses/${courseIdFromUrl}`)
      .then((response) => response.json())
      .then((data) => {
        if (data.course && data.course.questions) {
          setQuestions(data.course.questions);
          setTotalLessons(data.course.totalLessons);
          
          // Notificare cÃ¢nd testul este gata
          toast.success('Testul a fost Ã®ncÄƒrcat. Succes!', 3000);
        }
      })
      .catch((error) => {
        console.error('Error fetching questions:', error);
        setError('Nu am putut Ã®ncÄƒrca Ã®ntrebÄƒrile pentru test.');
        toast.error('Nu am putut Ã®ncÄƒrca Ã®ntrebÄƒrile pentru test.');
      });
  }, [userId, authToken, toast]);

  const handleAnswerChange = useCallback((index, answerIndex) => {
    const updatedAnswers = [...selectedAnswers];
    updatedAnswers[index] = answerIndex;
    setSelectedAnswers(updatedAnswers);
  }, [selectedAnswers]);

  // FuncÈ›ie pentru salvarea progresului la test
  const saveProgress = useCallback(async (testScore) => {
    if (!userId || !courseId) {
      console.error('Lipsesc informaÈ›ii esenÈ›iale: userId sau courseId');
      toast.error('Nu se poate salva progresul - lipsesc informaÈ›ii esenÈ›iale');
      return;
    }

    setSaving(true);
    toast.info('Se salveazÄƒ rezultatul testului...', 2000);
    
    try {
      // ObÈ›inem progresul existent pentru acest curs
      const progressResponse = await fetch(`http://localhost:5000/api/user/progress/${userId}`);
      const progressData = await progressResponse.json();
      
      // GÄƒsim progresul pentru cursul curent
      const currentProgress = progressData.find(p => p.courseId._id === courseId);
      
      // DeterminÄƒm cÃ¢te lecÈ›ii au fost completate (pÄƒstrÄƒm valoarea existentÄƒ)
      const completedLessons = currentProgress ? currentProgress.completedLessons : totalLessons;

      // SalvÄƒm progresul actualizat
      const response = await fetch('http://localhost:5000/api/user/progress', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${authToken}`
        },
        body: JSON.stringify({
          userId,
          courseId,
          completedLessons,
          totalLessons,
          testScore,
        }),
      });
      
      const data = await response.json();
      
      if (!data.success) {
        throw new Error(data.message || 'Eroare la salvarea progresului');
      }
      
      toast.success('Rezultatul testului a fost salvat cu succes!');
      console.log('Progresul la test salvat cu succes');
    } catch (error) {
      console.error('Eroare la salvarea progresului testului:', error);
      setError('Nu am putut salva progresul. Te rugÄƒm sÄƒ Ã®ncerci din nou.');
      toast.error('Eroare la salvarea rezultatului. ÃŽncearcÄƒ din nou.');
    } finally {
      setSaving(false);
    }
  }, [userId, courseId, totalLessons, authToken, toast]);

  const handleNext = useCallback(() => {
    if (isAnswerChecked) {
      // Al doilea click - trecem la urmÄƒtoarea Ã®ntrebare
      if (currentQuestionIndex < questions.length - 1) {
        setCurrentQuestionIndex(currentQuestionIndex + 1);
        setIsAnswerChecked(false); // ResetÄƒm starea
        toast.info(`ÃŽntrebarea ${currentQuestionIndex + 2} din ${questions.length}`, 1500);
      } else {
        // La finalizarea testului, calculÄƒm scorul final È™i salvÄƒm progresul
        const finalScore = Math.round((score / questions.length) * 100);
        saveProgress(finalScore);
        
        // Feedback personalizat Ã®n funcÈ›ie de scor
        if (finalScore === 100) {
          toast.success('Perfect! Ai obÈ›inut scor maxim! ðŸ†', 5000);
        } else if (finalScore >= 80) {
          toast.success(`Excelent! Ai obÈ›inut ${finalScore}% la test! ðŸŽ‰`, 5000);
        } else if (finalScore >= 60) {
          toast.info(`Bun rezultat! Ai obÈ›inut ${finalScore}% la test. ðŸ‘`, 5000);
        } else {
          toast.warning(`Ai obÈ›inut ${finalScore}%. Poate ar trebui sÄƒ revezi lecÈ›iile. ðŸ“š`, 5000);
        }
        
        setIsFinished(true);
      }
    } else {
      // Primul click - validÄƒm rÄƒspunsul
      if (selectedAnswers[currentQuestionIndex] === undefined) {
        toast.warning('Te rugÄƒm sÄƒ selectezi un rÄƒspuns!');
        return;
      }

      // VerificÄƒm dacÄƒ rÄƒspunsul este corect
      if (selectedAnswers[currentQuestionIndex] === questions[currentQuestionIndex].correctAnswerIndex) {
        setScore(prevScore => prevScore + 1); // ActualizÄƒm scorul
        toast.success('RÄƒspuns corect! +1 punct', 1500);
      } else {
        toast.error('RÄƒspuns greÈ™it!', 1500);
      }

      setIsAnswerChecked(true); // SetÄƒm cÄƒ rÄƒspunsul a fost verificat
    }
  }, [isAnswerChecked, currentQuestionIndex, questions, selectedAnswers, score, saveProgress, toast]);

  const handleRestart = useCallback(() => {
    setScore(0);
    setCurrentQuestionIndex(0);
    setSelectedAnswers([]);
    setIsFinished(false);
    setIsAnswerChecked(false); // ResetÄƒm starea pentru validarea rÄƒspunsurilor
    toast.info('Ai reÃ®nceput testul. Mult succes!', 3000);
  }, [toast]);

  const handleBackToProfile = useCallback(() => {
    toast.info('Te-ai Ã®ntors la profilul tÄƒu', 2000);
    navigate('/profile');
  }, [navigate, toast]);

  if (error) {
    return (
      <div className="quiz-error">
        <h2>Eroare la Ã®ncÄƒrcarea testului</h2>
        <p>{error}</p>
        <button onClick={() => navigate(-1)}>ÃŽnapoi</button>
      </div>
    );
  }

  if (questions.length === 0) {
    return <div className="quiz-loading">Se Ã®ncarcÄƒ Ã®ntrebÄƒrile...</div>;
  }

  const currentQuestion = questions[currentQuestionIndex];

  return (
    <div className="quiz-container">
      <h2>ÃŽntrebarea {currentQuestionIndex + 1}</h2>

      {!isFinished ? (
        <div className="question-container">
          <h3>{currentQuestion.question}</h3>
          <ul>
            {currentQuestion.options.map((option, index) => {
              let className = '';
              if (selectedAnswers[currentQuestionIndex] === index) {
                // AdaugÄƒ clasa selected la rÄƒspunsul ales
                className = 'selected';
              }
              if (isAnswerChecked) {
                if (index === questions[currentQuestionIndex].correctAnswerIndex) {
                  // RÄƒspuns corect - verde
                  className = 'correct';
                } else if (selectedAnswers[currentQuestionIndex] === index) {
                  // RÄƒspuns greÈ™it - roÈ™u
                  className = 'incorrect';
                }
              }
              return (
                <li
                  key={index}
                  className={className}
                  onClick={() => handleAnswerChange(currentQuestionIndex, index)} // ActivÄƒm click pe Ã®ntreaga listÄƒ
                >
                  <input
                    type="radio"
                    id={`question-${currentQuestionIndex}-option-${index}`}
                    name={`question-${currentQuestionIndex}`}
                    value={index}
                    checked={selectedAnswers[currentQuestionIndex] === index}
                    onChange={() => {}} // ManipulÄƒm schimbarea prin onClick pe li
                  />
                  <label htmlFor={`question-${currentQuestionIndex}-option-${index}`}>{option}</label>
                </li>
              );
            })}
          </ul>
          <button 
            onClick={handleNext}
            disabled={saving}
          >
            {isAnswerChecked ? 'Next' : 'VerificÄƒ RÄƒspunsul'}
          </button>
        </div>
      ) : (
        <div className="result-container">
          <h3>Testul S-a ÃŽncheiat</h3>
          <p>Punctajul tÄƒu: {score} din {questions.length}</p>
          <p className="score-percentage">Ai obÈ›inut {Math.round((score / questions.length) * 100)}%</p>
          
          <div className="result-actions">
            <button onClick={handleRestart}>Reia Testul</button>
            <button onClick={handleBackToProfile}>VizualizeazÄƒ Profilul</button>
          </div>
        </div>
      )}
    </div>
  );
}

export default Quiz;
